import { LEVELS } from "./levels.enum";


export class Task {
    name = '';
    description = '';
    completed =false;
    level = LEVELS;

    constructor(name, descrption, completed, level) {
        this.name = name;
        this.description = name;
        this.completed = completed;
        this.level = level
    }
}
